INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, "お！\nあそこに困ってそうな人発見！", 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "みんなみたいに\nわたしも強くならなきゃ", 1002, "大切な人を\n守れるようになりたい…って", 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "フェンシングを始めてみては？", 1003, "キミに必要な集中力と感性が", 0, 0, "少しは磨かれると思いますよ。", "士条 怜", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ねぇ、にいちゃん！", 1004, "今日はなにして遊ぶ？", 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "風宮あかりです", 1006, "ねぇ…", 0, 0, "私といっしょに…\nいかない？", "風宮 あかり", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "出雲宮子なのー", 1007, "プリンたべたいのー", 0, 0, "食べ物の恨みは怖いのー", "出雲 宮子", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ボクは虹村雪。", 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, "いいよ。\n見られることは運命さ…", "虹村 雪", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "フッ…聞いて後悔するがいい！", 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, "人呼んで「疾風の冥姫」!!", "柊杏奈", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, "ほんまおおきにやわ～♪", "姫宮 真歩", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "衣之咲璃乃です！", 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, "ここで会ったが\n100年目～！", "衣之咲 璃乃", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, "ち、超能力って…\n何のことかな～？", 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ちょす！\n美波鈴奈だよ～♪", 1016, "一応カリスマ読モJKやってまっす！", 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "はいたーい。\n喜屋武香織さー。", 1017, "東京は遊園地みたいなところさー", 0, 0, "でも、沖縄もとってもいいとこさー", "喜屋武 香織", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "支倉伊緒です。", 1018, "先生って呼ばれるのは\nくすぐったいから", 0, 0, "イオちゃんって呼んでね。", "支倉 伊緒", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, "ミミをおいてかないでぇ～", "茜 ミミ", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, "あの……\nふぇ……", 0, 0, "ふぇぇぇぇぇん……", "栗林 くるみ", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "風宮よりです。\nあああああ！", 1022, "こんな私に貴重な時間を\n割いていただき、", 0, 0, "なんてありがとうございます！", "風宮 より", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, "おにいちゃんどこいくの？\nえ？", 0, 0, "私こっち行きたいー\nね、早く早くー", "北条 綾音", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "わっ…わっ…私、\n天野すずめといいます！", 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, "これて何か違う…\nあああすみません！", "天野 すずめ", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "……クスクス…私は\n…倉石恵理子……", 1027, "あなたは…運命の……\n伴侶……", 0, 0, "離しませんわ………\n絶対に…!!", "倉石 恵理子", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, "…そうでしょ？？", "佐々木 咲恋", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "桜井望だよ！\nよろしくねっ", 1029, "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, "あはは、\n私もまだまだだなぁ～", "桜井 望", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "デケデケデンっ！", 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "上喜しのぶです。\n手元のドクロが父です。", 1031, "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, "おかしいですね……", "上喜 しのぶ", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, "けんども\nそれには足りないモンが…", 0, 0, "そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, "ちょっと緊張しちゃって…", 0, 0, "ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "氷川鏡華…です", 1036, "知らない人とは話しちゃいけないので", 0, 0, "これ以上お話しすることは…\nないです！", "氷川 鏡華", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "柏崎…栞です。", 1038, "……あ、アラーム。", 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "ふ、双葉碧です。", 1040, "私、一人も友達がいなくて……", 0, 0, "野に咲く花が、\n唯一の話相手です。", "双葉 碧", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "三角千歌です。", 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, "そう思っています。", "三角 千歌", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "安芸真琴だ。", 1043, "あぁ？\nお前のそいつの仲間か？", 0, 0, "う、疑ってすまなかったな…", "安芸 真琴", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "わらわこそは夜を総べる者！", 1044, "生けとし生ける全ての者よ！", 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "そこで騎士は妖精を乱暴に……", 1045, "ぐふふふふ……はっ！", 0, 0, "ｌク、クウカに何かご用ですか!?", "遠見 空花", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "大神美冬よ！", 1048, "それでは早速クエストに…", 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "星野静流だよ！", 1049, "クエストもバトルも\n掃除も洗濯も", 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "アタシは玉泉美咲。", 1050, "見ての通りの\nセクシー美少女で", 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "？？？", 1052, "？？？？", 0, 0, "？？？？", "リマ", 0, 2, 1.4, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "モニカ・ヴァイスヴィントだ。", 1053, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィント", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "モニカ・ヴァイスヴィントだ。", 1058, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", "ペコリーヌ", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "モニカ・ヴァイスヴィントだ。", 1059, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", "コッコロ", 0, 2, 1.5, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1, 1, 1, "モニカ・ヴァイスヴィントだ。", 1060, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", "キャル", 0, 2, 1.5, 0);
